sys_variable_value.value:
// ---------------------------------------------------------------------
// GET THE FORM VALUE
//
var formPhrase = current.variables.phrase;
gs.info("formPhrase: " + formPhrase);
//----------------------------------------------------------------------
// RUN PIPELINE
// 
// create RESTMessage object & execute the message
var runPipelineMessage = new sn_ws.RESTMessageV2();
runPipelineMessage.setRequestHeader("Authorization", "Basic OmUyb3MyZG1qbmtkMmFmaGxhaG12bHYyeDRuNWxpd2NzZmZzd2x4NGluZTdkN3ZwYjQ0eXE=");
// build endpoint (based on phrase)
runPipelineMessage.setEndpoint('https://dev.azure.com/MasonGelletly/ServiceNow%20Integration/_apis/pipelines/1/runs?api-version=6.0-preview.1');
// set httpMethod (post)
runPipelineMessage.setHttpMethod('post');
// set request header
runPipelineMessage.setRequestHeader('content-type', 'application/json');
// build and set the body
var body = '{"resources": { "repositories": { "self": { "refName": "refs/heads/main" } } }, "variables": { "HELLO_WORLD": { "isSecret": false, "value": "HelloWorldValue" }, "phrase": { "value": "' + formPhrase + '" } } }';
runPipelineMessage.setRequestBody(body);
// execute
var postExe = runPipelineMessage.execute();
// ---------------------------------------------------------------------
// GET BUILD ID (and proof of access to phrase)
// 
// get body and create JSON object
var resBody = postExe.getBody();
gs.info("AH: " + resBody);
var resBodyJSON = JSON.parse(resBody);
// get the buildId
var buildId = resBodyJSON.id;
// ----------------------------------------------------------------------
// prove access to phrase
gs.info("phraseFromJSON: " + resBodyJSON.variables.phrase.value);
// ---------------------------------------------------------------------
// CREATING RESTMESSAGE - GET PIPELINE RUN
//
// create default restmessage object to serve as foundation of our method call
var stateMessage = new sn_ws.RESTMessageV2();
stateMessage.setRequestHeader("Authorization", "Basic OmUyb3MyZG1qbmtkMmFmaGxhaG12bHYyeDRuNWxpd2NzZmZzd2x4NGluZTdkN3ZwYjQ0eXE=");
// set endpoint (based on previously found buildID)
stateMessage.setEndpoint('https://dev.azure.com/MasonGelletly/ServiceNow%20Integration/_apis/pipelines/1/runs/' + buildId + '?api-version=6.0-preview.1');
// set httpMethod (get)
stateMessage.setHttpMethod('get');
// set request headers
stateMessage.setRequestHeader('Accept', 'application/json');
stateMessage.setRequestHeader('content-type', 'application/json');
// ---------------------------------------------------------------------
// GETTING STATE
// 
// execute the message and print state to log
var execute = stateMessage.execute();
var stateBody = execute.getBody();
var stateBodyJSON = JSON.parse(stateBody);
// ---------------------------------------------------------------------
// GETTING STATE EVERY 6 SECONDS
//
// function to be run. checks for the current state and deals accordingly
function getRunState(){
	// get the state
	var execute = stateMessage.execute();
	var stateBody = execute.getBody();
	var stateBodyJSON = JSON.parse(stateBody);
	var currentState = stateBodyJSON.state;
	gs.info('stateMidRun: ' + currentState);
	
	// return the state
	return currentState;
}
// get the initial state 
var changingState = getRunState();

// scriptInclude to allow access to function mySleep()
var scriptInclude = new global.mySleep();

// check every 6 seconds if state has left "inProgress"
while (changingState == "inProgress"){
	changingState = getRunState();
	scriptInclude.mySleep(6000);
}

